			<key>shellScript</key>
			<string># Initialization of Crashlytics

# Getting build secret
BUILD_SECRET=$FABRIC_BUILD_SECRET

# Getting api key from Info.plist
API_KEY=$(/usr/libexec/PlistBuddy "${PRODUCT_SETTINGS_PATH}" -c "Print :Fabric:APIKey")

if [ -n "$BUILD_SECRET" ]; then
    if [[ $? -ne 0 ]]; then
        echo "Crashlytics not installed, skipping"
    else
        if [ -n "$API_KEY" ]; then
            echo "Uploading symbols to crashlytics" "$API_KEY" "$BUILD_SECRET"
            "${PODS_ROOT}/Fabric/Fabric.framework/run" "$API_KEY" "$BUILD_SECRET"
        else
            echo "Crashlytics not installed, skipping"
        fi
    fi
else
    echo "Crashlytics build secret not set, skipping"
fi</string>
